import React from 'react'

const Electronics = ({products}) => {
    const electronicProducts = products.map(prod => prod)

    const filteredElectronic = electronicProducts.filter((product) => {
        return product.includes("electronics")
    })

    return (
    <div>
        {filteredElectronic} 
    </div>
    )
}
export default Electronics
